import React, { useState } from 'react';
import './App.css';
import Footer from './components/footer';
import Header from './components/header';
import Project from './components/project';
import About from './components/About';
import Experience from './components/experiencia';
import Formation from './components/formation';
import Hobbies from './components/hobbies';
import Courses from './components/courses';
import Event from './components/eventos';
import Hero from './components/hero';
import Tecnologias from './components/tecnologias';
import Skills from './components/skills';
import ContactComponent from './components/contact';

const App = () => {
  const [language, setLanguage] = useState('pt-BR');

  const handleLanguageChange = () => {
    setLanguage(language === 'pt-BR' ? 'en' : 'pt-BR');
  };

  return (
    <div>
      <Header />
      <button onClick={handleLanguageChange}>
        aaa
        {language === 'pt-BR' ? 'English' : 'Português'}
      </button>
      <main>
        <Hero language={language} />
        <About language={language} />
        <Experience language={language} />
        <Formation language={language} />
        <Tecnologias language={language} />
        <Skills language={language} />
        <Hobbies language={language} />
        <Project language={language} />
        <Courses language={language} />
        <Event language={language} />
        <ContactComponent language={language} />
      </main>
      <Footer />
    </div>
  );
}

export default App;
